import React from "react";
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";

import Header from "./Header";
import Cats from "./Cats";
import Dogs from "./Dogs";
import "./App.css";

function Main() {
  return (
    <BrowserRouter >
    <div className="main">
      <Header />
      <Switch>
    <Route path="/cats" children={<Cats />} />
    <Route path="/dogs" children={<Dogs />} />
    </Switch>
    </div>

    </BrowserRouter>

  );
}

export default Main;
